import React from 'react';
import './BlogPage.css';
import blogImage1 from '../../assets/images/blog1.jpg'; // Make sure to have blog images
import blogImage2 from '../../assets/images/blog2.jpg';
import blogImage3 from '../../assets/images/blog3.jpg';

const BlogPage = () => {
  return (
    <div className="blog-page">
      <header className="blog-header">
        <h1>Our Blog</h1>
        <p>Discover insights, trends, and stories from the world of smart construction.</p>
      </header>

      <div className="blog-content">
        {/* Blog Post 1 */}
        <div className="blog-post">
          <img src={blogImage1} alt="Latest Trends in Smart Construction" className="blog-post-image" />
          <h2>Latest Trends in Smart Construction</h2>
          <p>
            Discover the most recent advancements and innovations that are transforming the construction industry using AI technologies...
          </p>
          <a href="#" className="read-more-btn">Read More</a>
        </div>

        {/* Blog Post 2 */}
        <div className="blog-post">
          <img src={blogImage2} alt="Why AI is Important in Real Estate" className="blog-post-image" />
          <h2>Why AI is Important in Real Estate</h2>
          <p>
            Learn how Artificial Intelligence is reshaping the real estate landscape, making processes more efficient and data-driven...
          </p>
          <a href="#" className="read-more-btn">Read More</a>
        </div>

        {/* Blog Post 3 */}
        <div className="blog-post">
          <img src={blogImage3} alt="Construction Management Tools" className="blog-post-image" />
          <h2>Construction Management Tools</h2>
          <p>
            Explore the various construction management tools that are leveraging AI to improve project delivery timelines and quality...
          </p>
          <a href="#" className="read-more-btn">Read More</a>
        </div>
      </div>
    </div>
  );
};

export default BlogPage;
